Lost Highway: The Story of Country Music

Arts Documentary hosted by Anthony Howell, published by BBC in 2003 - English narration


Information
------------------------------

The four-part, four-hour documentary travels the Lost Highway and uncovers the story of country music on a journey to the heart of America and the music that has come to define it.
From the makers of the award-winning series Dancing in the Street and Walk On By comes another major heritage music series charting the history of American country music in the words of its greatest performers, producers, musicians and songwriters.
Lost Highway will chart the history and growth of country music from its roots in mountain music, through bluegrass to the emergence of Hank Williams and honky tonk, the rise of the pop friendly Nashville Sound, the extraordinary emergence of female performers to positions of dominance in the industry and the success of newer forms of the genre from country rock to alt. country.
It includes exclusive contributions from Emmylou Harris, Alison Krauss, Gillian Welch, Hank Williams III, Kris Kristofferson and Dolly Parton amongst others.

Lost Highway: The Story of Country Music is produced by William Naylor; the series editor is Michael Poole.

4)  Sweethearts of the Rodeo 
While acts such as Shania Twain or the Dixie Chicks sell millions, it's easy to forget that women's dominance in country has been an uphill struggle. &quot;Sweethearts of the Rodeo&quot; tells the story from the original cowgirl, Patsy Montana, to the outspoken big-haired icons of the '60s and '70s and today's stars including Gillian Welch.

